Method.Source:
[Form]
public final class CustRORSubStatusJournal extends FormRun
{
    InventDimCtrl_Frm_Mov           inventDimFormSetup;

    BOBRentalSubStatus              rentalSubStatus;
}

public Common docCursor()
{
    Common docCursor;

    docCursor = super();

    if (docCursor.TableId == tableNum(InventDim))
    {
        docCursor = CustRORSubStatusTrans;
    }

    return docCursor;
}

void init()
{
    #WinAPI;

    if (element.args().parmEnumType() == enumNum(BOBRentalSubStatus))
    {
        rentalSubStatus = element.args().parmEnum();
    }

    super();

    if (element.args().record())
    {
        CustRORSubStatusJour_ds.object(fieldNum(CustRORSubStatusJour, InvoiceAccount)).visible(false);
    }

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    SalesLine       salesLine;
    InventMovement  movement = InventMovement::construct(salesLine);
    boolean         hasRentalDates = (isConfigurationkeyEnabled(configurationKeyNum(RORRentalDateTimes))
                    && CustRORSubStatusJour.salesTable().SalesType == SalesType::RORRental);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);
            }

        case InventDimFormDesignUpdate::Active :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(false);
            break;

        default : throw error(strFmt("@SYS54195", funcName()));
    }

    TabHeaderRentalDates.visible(hasRentalDates);
    TabLineRentalDates.visible(hasRentalDates);
}

public void init()
{
    QueryBuildDataSource  queryDataSourceLink;

    super();

    if (element.args().dataset() == tableNum(SalesTable))
    {
        this.query().dataSourceTable(tableNum(CustRORSubStatusJour)).clearDynalinks();

        queryDataSourceLink = this.query().dataSourceTable(tableNum(CustRORSubStatusJour)).addDataSource(tableNum(CustRORSubStatusSalesLink));
        queryDataSourceLink.relations(true);
        queryDataSourceLink.addDynalink(fieldNum(CustRORSubStatusSalesLink, OrigSalesId),
                                        element.args().record(),
                                        fieldNum(SalesTable, SalesId));
    }

    if (element.args().dataset() == tableNum(SalesQuotationTable))
    {
        this.query().dataSourceTable(tableNum(CustRORSubStatusJour)).clearDynalinks();

        queryDataSourceLink = this.query().dataSourceTable(tableNum(CustRORSubStatusJour)).addDataSource(tableNum(CustRORSubStatusSalesLink));
        queryDataSourceLink.relations(true);
        queryDataSourceLink.addDynalink(fieldNum(CustRORSubStatusSalesLink, OrigSalesId),
                                        element.args().record(),
                                        fieldNum(SalesQuotationTable, SalesIdRef));
    }

    if (element.args().dataset() == tableNum(smmBusRelTable))
    {
        this.query().dataSourceTable(tableNum(CustRORSubStatusJour)).clearDynalinks();

        queryDataSourceLink = this.query().dataSourceTable(tableNum(CustRORSubStatusJour)).addDataSource(tableNum(CustTable));
        queryDataSourceLink.addLink(fieldNum(CustRORSubStatusJour, OrderAccount), fieldNum(CustTable, AccountNum));
        queryDataSourceLink.addDynalink(fieldNum(CustTable, Party),
                                        element.args().record(),
                                        fieldNum(smmBusRelTable, Party));
    }

    if(rentalSubStatus != BOBRentalSubStatus::None)
    {
        this.queryBuildDataSource().addRange(fieldNum(CustRORSubStatusJour, BOBRentalSubStatus)).value(queryValue(rentalSubStatus));
    }
}

void clicked()
{
    CustRORSubStatusJour    custRORSubStatusJourLocal;

    for (custRORSubStatusJourLocal = getFirstSelection(CustRORSubStatusJour_ds);
         custRORSubStatusJourLocal;
         custRORSubStatusJourLocal = CustRORSubStatusJour_ds.getNext())
    {
        if (custRORSubStatusJourLocal.canXMLBeSent())
        {
            custRORSubStatusJourLocal.sendElectronically(PrintCopyOriginal::Original);
        }
        else
        {
            warning(strFmt("@SYS123402", custRORSubStatusJourLocal.SubStatusDocNum));
        }
    }

    super();
}

